players.forEach(function(player){
    console.log(player)
    const major = document.createElement('div')
    const title = document.createElement('h2')
    title.textContent=player.title
    const coun = document.createElement('p')
    coun.textContent=player.country
    const n = document.createElement('p')
    n.textContent = player.name
    const yr = document.createElement('p')
    yr.textContent=player.year
    const image = document.createElement('img')
    image.src=player.imageLink
    major.append(image,n,coun,title,yr) 
    major.classList.add('player')
    main.appendChild(major) 
})
